function validateCodesDoc75514() {
	var returnValDoc75514 = true;
	var sCodeRegexDoc75514 = /([0-9a-zA-Z]){8}/;
	var sCodeMsg = ''; var codeDefaultValueDoc75514 = ''; var codeVal = ''; codeCounter = '';
	skjq.each(skjq('#starpass_75514 #sk-kit .sk-input-code-field'), function(i, item)  {
		if(item.id.substring(0, 7) == 'sk-code') {
			// ID of the element (sk-code1, sk-code2, ...)
			codeDefaultValueDoc75514 = skjq("<div/>").html(txtTranslation[currentLanguageDoc75514][item.id]).text();
			
			codeVal = skjq('#starpass_75514 #sk-kit #'+item.id).val();
			codeCounter = item.id.substring(7, 8);
			
			if(codeVal == '' || codeVal == codeDefaultValueDoc75514) {
				sCodeMsg += '<li>' + skjq('#starpass_75514 #sk-kit #sk-error-empty-code').html().replace('XXXX',' ' + codeCounter) + '</li>';
				returnValDoc75514 = false;
			} else if(!codeVal.match(sCodeRegexDoc75514)){
				sCodeMsg += '<li>' + skjq('#starpass_75514 #sk-kit #sk-error-code-format').html().replace('XXXX',codeVal) + '</li>';			
				returnValDoc75514 = false;
			}
		}
	});
	if(returnValDoc75514 == false) displayAlertDoc75514('<ul>' + sCodeMsg + '</ul>');
	return returnValDoc75514;
}
function validatePaiementDoc75514() {
	var return_message = '';
	var mailPatternDoc75514 = /^[\w\-]+(\.[\w\-]+)*@[\w\-]+(\.[\w\-]+)*\.[\w\-]{2,}$/;
	if(currentAccessDoc75514 != 'sms' && currentAccessDoc75514 != 'audiotel') {
		var valSelectDoc75514 = skjq('#starpass_75514 #sk-kit #sk-code-choice-'+currentAccessDoc75514+' option:selected').val();
		if(valSelectDoc75514 <= 0) {
			return 'Error Access Type'; 
		}
	}
	var aCheckFormElementDoc75514 = {0:'customer-last-name',1:'customer-first-name',2:'customer-email',3:'customer-phone'};
	for(sKeyDoc75514 in aCheckFormElementDoc75514) {
		elVal = skjq('#starpass_75514 #sk-kit input[name="sk-'+aCheckFormElementDoc75514[sKeyDoc75514]+'"]').val();
		//alert(elVal);
		//fieldDefaultValueDoc75514 = elVal;
		fieldDefaultValueDoc75514 = skjq("<div/>").html(txtTranslation[currentLanguageDoc75514]['sk-'+aCheckFormElementDoc75514[sKeyDoc75514]]).text();
		
		if(elVal == "" || elVal == fieldDefaultValueDoc75514  ) {			
//			var sKeyElementForError = aCheckFormElementDoc75514[sKeyDoc75514].charAt(0).toUpperCase() + aCheckFormElementDoc75514[sKeyDoc75514].slice(1);
			var sKeyElementForError = aCheckFormElementDoc75514[sKeyDoc75514];
			//alert(sKeyElementForError);
			return_message += '<li>' + skjq("<div/>").html(txtTranslation[currentLanguageDoc75514]['sk-error-'+sKeyElementForError]).text() + '</li>';
			//return_message += txtTranslation[currentLanguageDoc75514]['sk-error-'+sKeyElementForError];
		}
	}
	if(skjq('#starpass_75514 #sk-kit input[name="sk-customer-email"]').val() != '' && skjq('#starpass_75514 #sk-kit input[name="sk-customer-email"]').val() != txtTranslation[currentLanguageDoc75514]['sk-customer-email']) {
		if (!mailPatternDoc75514.test(skjq('#starpass_75514 #sk-kit input[name="sk-customer-email"]').val())){
			console.log(skjq('#starpass_75514 #sk-kit input[name="sk-customer-email"]'));
			return_message += '<li>' + skjq("<div/>").html(txtTranslation[currentLanguageDoc75514]['sk-error-customer-incorrect-email']).text() + '</li>';
			//return_message += '<li>' + skjq("<div/>").html(txtTranslation[currentLanguageDoc75514]['sk-error-incorrect-email']).text() + '</li>';
			//return_message += txtTranslation[currentLanguageDoc75514]['sk-error-incorrect-email'];
			
		}
	}
	if(return_message != '') return '<ul>' + return_message + '</ul>';
	return true;
}
